The Borderline Mural Project covers a 200 foot long wall in the tunnels under the campus of MIT with murals and magic. The magic comes in the form of augmented reality: viewers can use a mobile phone app to experience an extension of the imagery. Now that's cool!

See more at: theborderlinetunnel.wordpress.com

