Code Next a collaboration between researchers from the @mitmedialab and @google aims to create a new generation of computer scientists innovators and inventors and have them emerge from the underserved 8-12th grade black and latino populations. The pilot launched in January 2016 with two laboratories one in NYC and one in Oakland.

@kqedofficial reporter Queena Sook Kim recently highlighted Code Next and its efforts to encourage high school students to learn to code through the process of making. â€œCoding is also making and it takes the same problem-solving skills as making stuff in real lifeâ€ Kim explains. Read moreâ€”and listen to her reportâ€”at bit.ly/codenextMIT

